const dataActiveScript: any = {
    0: { title: 'Ngừng kích hoạt', id: false },
    1: { title: 'Kích hoạt', id: true },
};

const dataStatusScript: any = {
    0: { title: 'Chưa sử dụng', id: 0 },
    1: { title: 'Đang sử dụng', id: 1 },
    2: { title: 'Đang tạo đơn hàng', id: 2 },
    3: { title: 'Tạm ngừng', id: 3 },
    4: { title: 'Đã sử dụng', id: 4 },
};

export { dataActiveScript, dataStatusScript };
